def data_uri_to_cv2_img(uri):
	str_split = uri.split(',')
	if(len(str_split) > 1) :
		encoded_data = uri.split(',')[1]
		nparr = np.fromstring(encoded_data.decode('base64'), np.uint8)
		img = cv2.imdecode(nparr, cv2.IMREAD_COLOR)
		return img
	else :
		nparr = np.fromstring(uri.decode('base64'), np.uint8)
		img = cv2.imdecode(nparr, cv2.IMREAD_COLOR)
		return img
	return None

